```
int binarySearch(int[] A, int key) {
    int low = 0;
    int high = A.length -1;
    while (low <= high) {
        int mid = low + (high - low) /2;
        if (A[mid] == key) {
            return mid; // found!
        } else if (A[mid] < key) { // key is smaller than A[mid] so mid is too small, so move high to next position
            high = mid -1;
        } else { // key is larger than A[mid] so mid is too large, so move low to next position
            low = mid +1;
        }
    } // if key not found, return -1 (end of array) otherwise return mid +1 (index of key) which is also end of array and return -1 from function above. (end of function)*/```
